import React from 'react';
import { CardImg, Container } from 'react-bootstrap';
import AppNavBar from '../layouts/AppNavbar';
import logo from "./../img/freely-logo-final.png";
export default function Download() {
	const gotoLink  = () => {
		window.open("https://play.google.com/store/apps/details?id=com.freellyapp", "_blank");
	  };


	return (
		<div>
			<AppNavBar/>
			<Container>
		<div style={{
			 display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
		marginTop:120,

		}}>
		<CardImg
			alt="Card image cap"
			bottom
			src={logo}
			style={{
				width:"40%"
			}}
			/>
		</div>
			</Container>
			<Container>
			<button className="downloadApp-banner" onClick={gotoLink}></button>
			</Container>
		</div>
	)
}
